'''Natalia Gastiain Tena''' (born 1 November 1984) is a British actress and musician. She is best known for playing the role of [[wikipedia:Nymphadora Tonks|Nymphadora Tonks]] in the ''[[wikipedia:Harry Potter|Harry Potter]]'' films ''[[wikipedia:Harry Potter and the Order of the Phoenix (film)|Harry Potter and the Order of the Phoenix]]'', ''[[wikipedia:Harry Potter and the Half-Blood Prince (film)|Harry Potter and the Half-Blood Prince]]'' and ''[[wikipedia:Harry Potter and the Deathly Hallows (film)|Harry Potter and the Deathly Hallows]]''. She also appeared the film ''[[wikipedia:About a Boy|About a Boy]]''. As a musician she sings and plays accordion in the band [[wikipedia:Molotov Jukebox|Molotov Jukebox]].

In ''[[Game of Thrones]]'', Natalia Tena plays the role of [[Osha]] and was confirmed for the role on 17 July 2010. She initially appeared as a guest star in the [[Season 1|first season]] and returned in this role for the [[Season 2|second]] and [[Season 3|third]] season. Tena has not appeared in the [[Season 4|fourth season]]. On October 6, 2014, fellow actor [[Art Parkinson]], who plays the role of [[Rickon Stark]], confirmed that Tena's character would not be returning for the [[Season 5|fifth season]].&lt;ref&gt;[http://winteriscoming.net/2014/10/06/art-parkinson-confirms-rickon-osha-still-awol/ Art Parkinson Confirms Rickon, Osha Still AWOL]&lt;/ref&gt;
